import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './MyComponents/Navbar';
import Home from './MyComponents/Home';
import Nova from './MyComponents/Nova';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          path="/"
          element={
            <>
              <Home />

            </>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
